import Navbar from './components/Navbar';
import Race from './components/Race';
import React, { useEffect, useState } from "react";
import './App.css';

function App() {


  const restURL = "http://localhost:8081/race/rest/races/";
    const [races, setRaces] = useState([])
    const [idForRace, setRaceId] = useState([])

    const passId = (id) => {
      setRaceId(id)
    }

    const fetchData = () => {
        fetch(restURL, {
            headers: {
                mode: 'no-cors',
                method: "GET",
                'Content-Type': 'application/json',
            }
        })
            .then(response => {
                return response.json()
            })
            .then(data => {
              setRaces(data)
            })
    }

    useEffect(() => {
        fetchData()
    }, [])
    let raceList=[];
    races.forEach(element => {
      raceList.push(
        <Race id={element.id}/>
      )
    });
    console.log(races)
  return (
    <div className="App">
      <h1>Race Organization</h1>
      <Navbar />
      <div className="main">
        {raceList}
      </div>
    </div>

  );
}

export default App;
